import React from "react";
import Formlogin from "../components/formlogin";
import Header from "../components/head";

export default function index() {
  return (
    <>
      <Header />
      <div className="container">
        <div className="logInfo">
          <Formlogin />
        </div>
        <div className="logImg"></div>
      </div>
    </>
  );
}
